import React from 'react';
import PropTypes from 'prop-types';

const AddPage = ({ currentView, handleBackClick }) => {

    const [formData, setFormData] = useState({
        name: '',
        email: '',
        message: ''
    });

    // Fungsi untuk menangani perubahan nilai input
    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    // Fungsi untuk menangani pengiriman formulir
    const handleSubmit = (e) => {
        e.preventDefault();
        // Lakukan sesuatu dengan data formulir yang dikumpulkan
        console.log(formData);
    };

    return (
        <div className="row">
            <div className="col-lg-12">
                <div className="mb-3">
                    <div className="divider text-start">
                    <div className="divider-text">
                        <span className="menu-header-text fs-6">Tambah Data Mobil</span>
                    </div>
                    </div>
                </div>
            </div>
            <div className="col-lg-12">
                <div className="">
                    Klik <button className="fw-bold btn btn-link p-0" onClick={handleBackClick}>disini</button> untuk kembali ke menu utama Mobil.
                </div>
            </div>
            <div className="col-md-12 mt-3">
                <form id="form">
                    <div className="row">
                        <div className="col-12">
                            <label htmlFor="nopol" className="form-label">Plat Nomor Mobil</label>
                                <input className="form-control" type="text" id="nopol" placeholder="X 0000 XX"/>
                        </div>
                        <div className="col-md-3 col-sm-12 mt-4">

                        </div>
                    </div>
                </form>
            </div>
        </div>
    );
};

AddPage.propTypes = {
    currentView: PropTypes.string.isRequired,
    handleBackClick: PropTypes.func.isRequired
};

export default AddPage;
